#!/usr/bin/env python3

s = "" 
fin = open("codons.dat","r")
lines = fin.readlines()
cds = {}
for lns in lines:
    print(lns)
    wds = lns.split(' ')
    cds[wds[0].strip()]=wds[1].strip()

prot = s.translate(cds)
ll = len(s)

for i in    range(0,ll,3):
    prot = prot + cds[s[i:i+3]]

print (prot)      
    
